import logo from './logo.svg';
import './App.css';
import Login from './Login';
import Dashboard from './UserDashboard';
import { Routes ,Route } from 'react-router';

function App() {
  return (
    <>
    <Login/>


  <Routes>       
     <Route exact path="/" element={<Login/>}></Route>
        <Route path="/dashboard" element={<Dashboard/>}/>
        </Routes>




    </>
  );
}

export default App;
